(function execute(inputs, outputs) {
    var utils = new WrikeUtils();
    utils.validateInputVariables(inputs, outputs);
    utils.validateMandatoryVariables(inputs, ['folderid']);
    utils.mapToOutputFromInput(inputs, outputs, ['folderid']);
})(inputs, outputs);

