sys_variable_value.value:
(function execute(inputs, outputs) {
  var addshareIds = [];
  var removeshareIds = [];
  var addParents = [];
  var removeParents = [];
  addshareIds = inputs.adShareds;
  removeshareIds = inputs.reShareds;
  addParents = inputs.adParents;
  removeParents = inputs.reParents;
  if(addshareIds != ""){
    outputs.addshareids = JSON.stringify(addshareIds);
  }
  else{
    outputs.addshareids = "";
  }
  if(removeshareIds != ""){
    outputs.removeshareids = JSON.stringify(removeshareIds);
  }
  else{
    outputs.removeshareids = "";
  }
  if(addParents != ""){
    outputs.addparents = JSON.stringify(addParents);
  }
  else{
    outputs.addparents = "";
  }
  if(removeParents != ""){
    outputs.removeparents = JSON.stringify(removeParents);
  }
  else{
    outputs.removeparents = "";
  }

})(inputs, outputs);

